import React from 'react';
import Breadcrumb from '../components/Breadcrumb';
import { Link, useNavigate } from 'react-router-dom';

export default function Cozumler() {
  const navigate = useNavigate();

  const handleClick = (path) => {
    console.log('Tıklanan link:', path);
    try {
      // Önce navigate ile deneyelim
      navigate(path);
      console.log('Navigate başarılı');

      // 1 saniye sonra hala aynı sayfadaysak window.location ile deneyelim
      setTimeout(() => {
        if (window.location.pathname === '/cozumler') {
          console.log('Navigate başarısız, window.location deneniyor');
          window.location.href = path;
        }
      }, 1000);
    } catch (error) {
      console.error('Yönlendirme hatası:', error);
      // Hata durumunda window.location ile deneyelim
      window.location.href = path;
    }
  };

  return (
    <div className="container mx-auto py-10 px-4">
      <Breadcrumb />
      <h1 className="text-3xl font-bold text-blue-800 mb-6 text-center">Çözümlerimiz</h1>
      <p className="text-center text-gray-600 mb-10">Tescom olarak birçok sektöre özel kesintisiz güç çözümleri sunuyoruz.</p>
      <div className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-6 gap-6">
        <button 
          onClick={() => handleClick('/cozumler/endustriyel')} 
          className="bg-white rounded-xl shadow p-6 flex flex-col items-center hover:shadow-lg transition cursor-pointer w-full text-left"
        >
          <div className="text-pink-500 text-3xl mb-2">🏭</div>
          <div className="font-bold text-lg mb-1">Endüstriyel</div>
          <p className="text-gray-600 text-center mb-2">Endüstriyel kontrol uygulamaları için güvenilir UPS çözümleri.</p>
        </button>
        <button 
          onClick={() => handleClick('/cozumler/medikal')} 
          className="bg-white rounded-xl shadow p-6 flex flex-col items-center hover:shadow-lg transition cursor-pointer w-full text-left"
        >
          <div className="text-blue-400 text-3xl mb-2">💉</div>
          <div className="font-bold text-lg mb-1">Medikal</div>
          <p className="text-gray-600 text-center mb-2">Hastane ve tıp tesisleri için kesintisiz enerji.</p>
        </button>
        <button 
          onClick={() => handleClick('/cozumler/veri-merkezi-it')} 
          className="bg-white rounded-xl shadow p-6 flex flex-col items-center hover:shadow-lg transition cursor-pointer w-full text-left"
        >
          <div className="text-green-400 text-3xl mb-2">💻</div>
          <div className="font-bold text-lg mb-1">Veri Merkezi & IT</div>
          <p className="text-gray-600 text-center mb-2">Veri merkezleri ve sunucu altyapıları için ölçeklenebilir çözümler.</p>
        </button>
        <button 
          onClick={() => handleClick('/cozumler/ev-ofis')} 
          className="bg-white rounded-xl shadow p-6 flex flex-col items-center hover:shadow-lg transition cursor-pointer w-full text-left"
        >
          <div className="text-yellow-400 text-3xl mb-2">🏠</div>
          <div className="font-bold text-lg mb-1">Ev & Ofis</div>
          <p className="text-gray-600 text-center mb-2">Ev ve küçük ofisler için pratik UPS çözümleri.</p>
        </button>
        <button 
          onClick={() => handleClick('/cozumler/ulasim')} 
          className="bg-white rounded-xl shadow p-6 flex flex-col items-center hover:shadow-lg transition cursor-pointer w-full text-left"
        >
          <div className="text-blue-700 text-3xl mb-2">🚆</div>
          <div className="font-bold text-lg mb-1">Ulaşım</div>
          <p className="text-gray-600 text-center mb-2">Tüm çevre koşullarında yüksek verimlilik ile çalışabilen ürünler.</p>
        </button>
        <button 
          onClick={() => handleClick('/cozumler/kompleksler')} 
          className="bg-white rounded-xl shadow p-6 flex flex-col items-center hover:shadow-lg transition cursor-pointer w-full text-left"
        >
          <div className="text-gray-700 text-3xl mb-2">🏢</div>
          <div className="font-bold text-lg mb-1">Kompleksler</div>
          <p className="text-gray-600 text-center mb-2">AVM, zincir market ve perakende sektörü için çözümler.</p>
        </button>
      </div>
    </div>
  );
}
